import React from 'react'
import { Input, Space, Card } from 'antd';

const { Search } = Input


export default function UniversalSearch() {

    const onSearch = value => console.log(value);

    return (
        <Card>
            <Space direction="vertical">
                <Search 
                    placeholder="input search text" 
                    onSearch={ onSearch } 
                    style={{ width: 200 }}                     
                    allowClear
                    enterButton="Search"
                    size="large" />
            </Space>
        </Card>
    )
}
